import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Login from './components/Login';
import VehicleList from './components/VehicleList';
import Dashboard from './components/Dashboard';
import MaintenanceSchedule from './components/MaintenanceSchedule';
import DamageReports from './components/DamageReports';
import FuelLog from './components/FuelLog';
import UserManagement from './components/UserManagement';
import StatisticsDashboard from './components/StatisticsDashboard';
import GlobalDashboard from './components/GlobalDashboard';
import UserDashboard from './components/UserDashboard';
import VehicleRequests from './components/VehicleRequests';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isAdmin, setIsAdmin] = useState(true); // Für Demo-Zwecke standardmäßig Admin
  const [sidebarOpen, setSidebarOpen] = useState(true);

  useEffect(() => {
    // Prüfen, ob der Benutzer bereits angemeldet ist (z.B. durch localStorage)
    const loggedIn = localStorage.getItem('isLoggedIn') === 'true';
    setIsLoggedIn(loggedIn);
  }, []);

  const handleLogin = () => {
    setIsLoggedIn(true);
    localStorage.setItem('isLoggedIn', 'true');
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
    localStorage.removeItem('isLoggedIn');
  };

  const toggleAdminMode = () => {
    setIsAdmin(!isAdmin);
  };

  if (!isLoggedIn) {
    return <Login onLogin={handleLogin} />;
  }

  return (
    <Router>
      <div className="flex h-screen bg-gray-100">
        <Sidebar 
          isOpen={sidebarOpen} 
          toggleSidebar={() => setSidebarOpen(!sidebarOpen)} 
          isAdmin={isAdmin}
          onLogout={handleLogout}
        />
        
        <div className="flex-1 overflow-auto">
          <div className="p-4 md:p-6">
            <div className="flex justify-between items-center mb-6">
              <h1 className="text-2xl font-bold text-gray-800">Fahrzeugverwaltung</h1>
              
              <div className="flex items-center">
                <span className="mr-2 text-sm">{isAdmin ? 'Admin-Modus' : 'Benutzer-Modus'}</span>
                <button 
                  onClick={toggleAdminMode}
                  className="px-3 py-1 text-sm bg-blue-500 text-white rounded hover:bg-blue-600"
                >
                  {isAdmin ? 'Zu Benutzeransicht wechseln' : 'Zu Admin-Ansicht wechseln'}
                </button>
              </div>
            </div>
            
            <Routes>
              <Route path="/" element={<Navigate to="/dashboard" />} />
              <Route 
                path="/dashboard" 
                element={isAdmin ? <GlobalDashboard /> : <UserDashboard />} 
              />
              <Route 
                path="/vehicles" 
                element={<VehicleList isUserView={!isAdmin} />} 
              />
              <Route 
                path="/maintenance" 
                element={<MaintenanceSchedule />} 
              />
              <Route 
                path="/damage-reports" 
                element={<DamageReports />} 
              />
              <Route 
                path="/fuel-logs" 
                element={<FuelLog />} 
              />
              {isAdmin && (
                <>
                  <Route 
                    path="/statistics" 
                    element={<StatisticsDashboard />} 
                  />
                  <Route 
                    path="/users" 
                    element={<UserManagement />} 
                  />
                  <Route 
                    path="/vehicle-requests" 
                    element={<VehicleRequests />} 
                  />
                </>
              )}
              <Route path="*" element={<Navigate to="/dashboard" />} />
            </Routes>
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
